import React, { useState } from "react";
import { useNavigate } from "react-router-dom";

const LoginForm = () => {
  const [username, setUsername] = useState("");
  const [password, setPassword] = useState("");
  const [error, setError] = useState("");

  const navigate = useNavigate();

  const handleLogin = async (e) => {
    e.preventDefault();
    setError("");

    try {
      const response = await fetch("https://qa-uaesaas-api.instapract.ae/web/api/default/login", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
          APPID: "Gem3s12345",
        },
        body: JSON.stringify({
          username,
          password,
          role_id: "143f37f2-ca38-0ab1-2489-1e47113655fc",
          device_id: "55c3389cb5ddd720dc0297617f3561c43a36218a277c974c8d43d545a643f45c",
          os_id: "b93a9204-ee21-4cf9-8a94-cf5eeabf7301",
          language: "da315627-3ece-2016-c628-b61dc5ee9be0",
        }),
      });

      const result = await response.json();
      console.log("Login API Response:", result);

      if (response.ok && result.success && result.data.access_token) {
        const token = result.data.access_token;
        localStorage.setItem("token", token);
        console.log("Token saved:", token);
        navigate("/doctor");
      } else {
        setError(result.msg || "Login failed");
      }
    } catch (err) {
      console.error("Login error:", err);
      setError("Something went wrong. Please try again.");
    }
  };

  return (
    <div className="flex items-center justify-center min-h-screen bg-gradient-to-br from-blue-100 via-white to-blue-200">
      <form
        onSubmit={handleLogin}
        className="bg-white p-8 rounded-2xl shadow-xl w-full max-w-md"
      >
        <h2 className="text-3xl font-bold mb-6 text-center text-blue-700">Sign In</h2>

        <div className="mb-5">
          <label className="block mb-2 text-sm font-medium text-gray-700">Username</label>
          <input
            type="text"
            value={username}
            onChange={(e) => setUsername(e.target.value)}
            className="w-full px-4 py-2 border border-gray-300 rounded-lg focus:ring-2 focus:ring-blue-500 focus:outline-none transition-all"
            required
          />
        </div>

        <div className="mb-5">
          <label className="block mb-2 text-sm font-medium text-gray-700">Password</label>
          <input
            type="password"
            value={password}
            onChange={(e) => setPassword(e.target.value)}
            className="w-full px-4 py-2 border border-gray-300 rounded-lg focus:ring-2 focus:ring-blue-500 focus:outline-none transition-all"
            required
          />
        </div>

        {error && (
          <div className="mb-4 text-red-500 text-sm text-center">{error}</div>
        )}

        <button
          type="submit"
          className="w-full bg-blue-600 hover:bg-blue-700 text-white font-semibold py-2.5 rounded-lg transition-all shadow-md hover:shadow-lg"
        >
          Login
        </button>
      </form>
    </div>
  );
};

export default LoginForm;
